titleDescription:
Trading floor-based Compliance Officer with responsibility for the following desks:
- Flow & Structured Interest Rates;
- XVA;
- Securities Lending;
- Client Financing;
- Firm Funding & Collateral Optimisation;
- CCP Optimisation.

- Financial Management. Direct responsibility for all manpower spend, infrastructure & software cap/amortization expenses within Global Fixed Income Technology;

- Resource Management. Managing and supporting over 2,500 technologists with a $350m annualised manpower spend;

- Work directly with over 10 MDs globally to support their departments on developing location & workforce strategy and continue to drive forward the strategy execution;
